import React, { Fragment, useState } from "react";
import { Card, CardHeader, CardBody } from "reactstrap";
import {
    Accordion,
    AccordionItem,
    AccordionItemHeading,
    AccordionItemButton,
    AccordionItemPanel,
} from 'react-accessible-accordion';
import moment from "moment";

const generateRandomNumber = (num) => {
    return Math.floor(Math.random() * num) + 1;
}

const PrimaryColorAccordianHelper = (props) => {
    return (
        <Fragment>
            <Card>
                <Accordion>
                    <AccordionItem>
                        <AccordionItemHeading>
                            <AccordionItemButton>
                                Active/Current Bid Count (How many unique people have bidded)
                            </AccordionItemButton>
                        </AccordionItemHeading>
                        <AccordionItemPanel>
                            <p>This listing has approximately <strong style={{ color: "blue" }}>{generateRandomNumber(50)}</strong> bids currently as of <strong style={{ color: "blue" }}>{moment(new Date()).format("MM/DD/YYYY hh:mm:ss a")}</strong>.</p>
                        </AccordionItemPanel>
                    </AccordionItem>
                    <AccordionItem>
                        <AccordionItemHeading>
                            <AccordionItemButton>
                                Watch/Watcher Count (People that've saved this listing)
                            </AccordionItemButton>
                        </AccordionItemHeading>
                        <AccordionItemPanel>
                            <p>This listing <strong>currently</strong> has approximately <strong style={{ color: "blue" }}>{generateRandomNumber(125)}</strong> people <strong style={{ color: "blue" }}>"Watching"</strong> this listing. These people have bookmarked this listing & are interested and will possibly bid later towards the end of bid collections.</p>
                        </AccordionItemPanel>
                    </AccordionItem>
                </Accordion>
            </Card>
        </Fragment>

    );
}
export default {
    PrimaryColorAccordianHelper
};
